import React from "react";
import Line from "./Line_charts";
import Radar from "./Radar_charts";
import Bar from "./Bar_charts";
import Polar from "./Polar_charts";

const Charts = () => {
  return (
    <div className="row">
      <div className="col-sm-12 col-md-12 col-lg-12">
        <br />
      </div>
      <div className="col-sm-12 col-md-12 col-lg-12 btn btn-primary">
        <div class="panel-heading">
          <h3>Bar Series</h3>
        </div>
      </div>
      <div className="col-sm-12 col-md-12 col-lg-12">
        <br />
        <br />
        <br />
      </div>


      <div className="col-sm-12 col-md-12 col-lg-12">
      <div className="row">      <div className="col-sm-12 col-md-6 col-lg-6">
        <Polar />
      </div>
      <div className="col-sm-12 col-md-6 col-lg-6">
        <Bar />
      </div></div>
      </div>







      <div className="col-sm-12 col-md-6 col-lg-6">
        <Line />
      </div>
      <div className="col-sm-12 col-md-6 col-lg-6">
        <Radar />
      </div>
    </div>
  );
};

export default Charts;
